import React from "react";
import  './Display.css';

function Display(ID){
const id=ID

return(
  <div class="vertical-menu">
  <a href="#" class="active">{id}</a>
  <a href="#">Link 1</a>
  <a href="#">Link 2</a>
  <a href="#">Link 3</a>
  <a href="#">Link 4</a>
</div>
);
}
export default Display;
